      <img class="materialboxed" src="https://pmcdeadline2.files.wordpress.com/2018/11/scrubs.jpg?w=681&h=383&crop=1" alt="1"/>
      <p className="legend">Find Doctors Near You</p>
    </div>
    <div>
      <img class='pharmacy'src="https://www.medprostaffing.com/wp-content/uploads/2019/05/iStock-922526244.jpg" alt="2" />
      <p className="legend">Compare Nearest Prescription Prices</p>
    </div>
    <div>
      <img class='pharmacy'src="https://media.gettyimages.com/photos/happy-pharmacist-working-at-a-drugstore-picture-id610573018" alt="2" />
      <p className="legend">Learn The Latest Medical & Wellness News</p>
    </div>
  </Carousel>
);
